# MODELO IA EMBEBIDO EN BASE64
modelo_b64 = """"""

def cargar_modelo_embebido():
    try:
        modelo_bytes = base64.b64decode(modelo_b64)
        modelo_io = io.BytesIO(modelo_bytes)
        modelo = joblib.load(modelo_io)
        return modelo
    except Exception as e:
        print("‚ùå Error al cargar modelo IA embebido:", e)
        return None

